import React from 'react'
import Show from '../components/Show_tmp'
import useFetch from '../handling/useFetch'

const Home = () => {
  const { error, isPending, data } = useFetch('http://localhost:8080/api/datalog')

  return (
    <div className='home'>
      {error && <div>{error}</div>}
      {isPending && <div>Loading..</div>}
      {data && <Show datalog={data} />}
    </div>
  )
}

export default Home
